const Axios = require('axios')
const Tesseract = require('tesseract.js')

const carsTest = require('../cameraFeed/carsTest.mp4')

let video = document.createElement('VIDEO')
video.src = carsTest

let canvas = document.createElement('canvas')
canvas.width = 400
canvas.height = 400
let context = canvas.getContext('2d')
context.globalCompositeOperation = 'difference'

setInterval(sendImage, 10000)

const sendImage = () => {

    // get screenshot from current video 

        // for each video in the current list of video endpoints
        context.drawImage(video, 0, 0, 640, 480)

    // read license plate (if there is any)

    // check db for the plate

    // if unrecognized, send to db and alert 

    let currentPlateNumber = '123456'

    // eventually changed to get unrecognized plates from db 
    let unrecognizedList = []

    if(!(unrecognizedList.includes(currentPlateNumber))){

        let response = Axios.post('/api/unrecognized/addUnrecognized', {
            plateNumber: currentPlateNumber
        })
        console.log(response)
    }

}

module.exports = sendImage
